import React, { useState } from "react";
import axios from "axios";

interface IUserLoginInfo {
  name?: string;
  pass?: string;
}

const Auth = () => {
  const [isLoading, setIsLoading] = useState<Boolean>(false);
  const [inputDatam, setInputData] = useState<IUserLoginInfo>({
    name: "",
    pass: "",
  });

  const sendData = (uData: any) => {
    console.log(uData)
  }

  const handleFormSubmission = (e: any) => {
      setIsLoading(true)

    e.preventDefault();
  };

  return (
    <div>
      <form onSubmit={handleFormSubmission}>
        <div id="u_name">
          <label htmlFor="name">Username:</label>
          <input
            name="name"
            type="text"
            onChange={(e) => setInputData({ name: e.target.value as string })}
          />
        </div>

        <div id="u_pass">
          <label htmlFor="pass">Password</label>
          <input
            type="password"
            onChange={(e) => setInputData({ pass: e.target.value as string })}
          />
        </div>

        <button type="submit">Log in</button>
      </form>
    </div>
  );
};

export default Auth;
